import React from "react";
import Card from "../../components/Card";
import blog4 from '../../assets/blog4.jpg';
import './style.css';

const Blog4 = props => {
    return (
        <div>
            <Card>
                <h1>10 Tips For Hosting A Digital Book Club</h1>
                <div className = "postedOn">Posted on April 6, 2021</div>
                <img src = {blog4} alt = "image" className = "Image" />
            </Card>
        </div>
    )
};

export default Blog4;
